import { MainPage, CityForecastPage, CityWeatherPage } from "../pages";

export const routes = [
  { path: "/", component: MainPage, exact: true },
  {
    path: "/city/:id",
    component: CityWeatherPage,
    exact: true,
    routes: [
      {
        path: "forecast",
        component: CityForecastPage,
        exact: true,
      },
    ],
  },
];
